import React, { Component } from "react";
import { connect } from "react-redux";
import { Container, Nav, Image } from "react-bootstrap";
import { logOut } from "../actions/authedUser";
import Navbar from "react-bootstrap/Navbar";
class Home extends Component {
  handleLogOut = (e) => {
    e.preventDefault();
    this.props.dispatch(logOut());
  };
  render() {
    const { authedUser, users } = this.props;
    const user = users[authedUser];
    return (
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">Would You ?</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home" active>
              Home
            </Nav.Link>
            <Nav.Link href="#features">New Question</Nav.Link>
            <Nav.Link href="#pricing">Leader Board</Nav.Link>
            <Navbar.Toggle />
          </Nav>
          {authedUser ? (
            <Navbar.Collapse className="justify-content-end">
              <Navbar.Text>Hello, {user.name}</Navbar.Text>
              <Image
                style={{
                  width: "25px",
                  height: "25px",
                  backgrounColor: "#fff",
                }}
                rounded
                src={user !== "undefined" ? user.avatarURL : "logo"}
              />
              <Nav.Link href="#pricing" onClick={this.handleLogOut}>
                Log Out
              </Nav.Link>
            </Navbar.Collapse>
          ) : (
            <div></div>
          )}
        </Container>
      </Navbar>
    );
  }
}
function mapStateToProps({ authedUser, users }) {
  return {
    authedUser,
    users,
  };
}
export default connect(mapStateToProps)(Home);
